[TonightsBoyfriend] India Summer (17281 / 12.18.2013)

I'm a stewardess which means I get to travel the world and see new and exciting things. It has it's drawbacks though. Someday's I don't get a chance to go out and the only sites I see are the ones located in my hotel room. Thankfully, last time I was in town I met Johnny at the hotel bar. He told me what he did for a living and he gave me his number. I decide to work up the nerve to call him over now that I'm back in town. Sure, it will cost me a bit, but I have the cash and he definitely seems well worth the money. Maybe next time I can take him along on one of my flights and we can join the mile high club together.

